function Netflix(props){
    return(
        <div className="card">
        <img src={props.imgsrc} alt="Dark" />
        <div>
        <span>Trending Netflix Series</span>
        </div>
        <h1>Dark</h1>
        <a href="https://react.dev/learn/passing-props-to-a-component" target="_blank"/>
        <button>Watch Now</button>
        </div>
    );
}

export default Netflix;
